package org.springframework.samples.petclinic.owner;

import static org.junit.jupiter.api.Assertions.*;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import org.junit.jupiter.api.Test;

import java.util.Locale;

public class PetTypeFormatterTest {

	private PetTypeFormatter controller;

	@BeforeEach
	public void setUp() {
		controller = new PetTypeFormatter();
	}

	@Test
	@DisplayName("Print with valid inputs returns non-null string")
	public void testPrintHappyPath() {
		// Given
		PetType petType = new PetType();
		Locale locale = Locale.ENGLISH;

		// When
		String result = controller.print(petType, locale);

		// Then
		assertNotNull(result);
	}

	@Test
	@DisplayName("Print with null petType throws exception")
	public void testPrintWithNullPetType() {
		// Given
		Locale locale = Locale.ENGLISH;

		// When & Then
		assertThrows(RuntimeException.class, () -> controller.print(null, locale));
	}

	@Test
	@DisplayName("Parse with valid text returns non-null PetType")
	public void testParseHappyPath() {
		// Given
		String text = "Dog";
		Locale locale = Locale.ENGLISH;

		// When
		PetType result = controller.parse(text, locale);

		// Then
		assertNotNull(result);
	}

	@Test
	@DisplayName("Parse with null text throws exception")
	public void testParseWithNullText() {
		// Given
		String text = null;
		Locale locale = Locale.ENGLISH;

		// When & Then
		assertThrows(RuntimeException.class, () -> controller.parse(text, locale));
	}

}
